import React, { useState, useEffect } from 'react';

const Dashboard = ({ supabase }) => {
  const [dbData, setDbData] = useState({
    metrics: {
      subscriberCount: 0,
      sentCount: 0,
      openCount: 0,
      clickCount: 0,
      bounceCount: 0,
      openRate: '0.00',
      clickRate: '0.00',
      bounceRate: '0.00',
      lastUpdated: new Date().toLocaleString()
    },
    recentSubscribers: [],
    recentCampaigns: [],
    recentBounces: [],
    tableStats: {}
  });
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        setIsLoading(true);
        const data = {
          metrics: {},
          recentSubscribers: [],
          recentCampaigns: [],
          recentBounces: [],
          tableStats: {}
        };

        // Define our expected tables
        const expectedTables = [
          'EmailCampaignClients',
          'email_campaigns',
          'email_activity',
          'email_bounces'
        ];

        // Get table counts for all expected tables
        const tableCounts = {};

        for (const table of expectedTables) {
          try {
            // Use count function for efficiency with large tables
            const { count, error: countError } = await supabase
              .from(table)
              .select('*', { count: 'exact', head: true });

            if (!countError) {
              tableCounts[table] = count || 0;
            } else {
              console.error(`Error counting ${table}:`, countError);
              tableCounts[table] = 'Error';
            }
          } catch (e) {
            console.error(`Exception counting ${table}:`, e);
            tableCounts[table] = 'Error';
          }
        }

        data.tableStats = tableCounts;

        // Get subscriber count
        data.metrics.subscriberCount = tableCounts['EmailCampaignClients'] || 0;

        // Get bounce count
        data.metrics.bounceCount = tableCounts['email_bounces'] || 0;

        // Get email activity counts by type
        try {
          // Get sent count
          const { count: sentCount, error: sentError } = await supabase
            .from('email_activity')
            .select('*', { count: 'exact', head: true })
            .eq('action', 'sent');

          if (!sentError) {
            data.metrics.sentCount = sentCount || 0;
          }

          // Get opened count
          const { count: openedCount, error: openedError } = await supabase
            .from('email_activity')
            .select('*', { count: 'exact', head: true })
            .eq('action', 'opened');

          if (!openedError) {
            data.metrics.openCount = openedCount || 0;
          }

          // Get clicked count
          const { count: clickedCount, error: clickedError } = await supabase
            .from('email_activity')
            .select('*', { count: 'exact', head: true })
            .eq('action', 'clicked');

          if (!clickedError) {
            data.metrics.clickCount = clickedCount || 0;
          }

          // Calculate rates
          if (data.metrics.sentCount > 0) {
            data.metrics.openRate = ((data.metrics.openCount / data.metrics.sentCount) * 100).toFixed(2);
            data.metrics.bounceRate = ((data.metrics.bounceCount / data.metrics.sentCount) * 100).toFixed(2);
          }

          if (data.metrics.openCount > 0) {
            data.metrics.clickRate = ((data.metrics.clickCount / data.metrics.openCount) * 100).toFixed(2);
          }

        } catch (e) {
          console.error('Error calculating email metrics:', e);
        }

        // Get recent subscribers (limited to 5 for performance)
        try {
          const { data: subscribers, error: subscribersError } = await supabase
            .from('EmailCampaignClients')
            .select('id, email, name, status, created_at')
            .order('created_at', { ascending: false })
            .limit(5);

          if (!subscribersError) {
            data.recentSubscribers = subscribers || [];
          }
        } catch (e) {
          console.error('Error fetching recent subscribers:', e);
        }

        // Get recent campaigns (limited to 5 for performance)
        try {
          const { data: campaigns, error: campaignsError } = await supabase
            .from('email_campaigns')
            .select('id, campaign_name, subject, status, sent_date')
            .order('created_at', { ascending: false })
            .limit(5);

          if (!campaignsError) {
            data.recentCampaigns = campaigns || [];
          }
        } catch (e) {
          console.error('Error fetching recent campaigns:', e);
        }

        // Get recent bounces (limited to 5 for performance)
        try {
          const { data: bounces, error: bouncesError } = await supabase
            .from('email_bounces')
            .select('id, email, bounce_type, reason, created_at')
            .order('created_at', { ascending: false })
            .limit(5);

          if (!bouncesError) {
            data.recentBounces = bounces || [];
          }
        } catch (e) {
          console.error('Error fetching recent bounces:', e);
        }

        data.metrics.lastUpdated = new Date().toLocaleString();
        setDbData(data);

      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setError('Failed to load dashboard data. Please try again.');
      } finally {
        setIsLoading(false);
      }
    };

    fetchDashboardData();

    // Refresh every 5 minutes
    const interval = setInterval(fetchDashboardData, 5 * 60 * 1000);

    return () => clearInterval(interval);
  }, [supabase]);

  if (isLoading) {
    return (
      <div className="dashboard-loading">
        <h1>Dashboard</h1>
        <div className="loading-spinner"></div>
        <p>Loading dashboard data...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="dashboard-error">
        <h1>Dashboard</h1>
        <div className="error-message">{error}</div>
        <button 
          className="retry-button"
          onClick={() => window.location.reload()}
        >
          Retry
        </button>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <h1>Dashboard</h1>

      {/* Key Metrics */}
      <section className="dashboard-section">
        <h2>Subscribers</h2>
        <div className="metric-value">{dbData.metrics.subscriberCount.toLocaleString()}</div>
      </section>

      <section className="dashboard-section">
        <h2>Emails Sent</h2>
        <div className="metric-value">{dbData.metrics.sentCount.toLocaleString()}</div>
      </section>

      <section className="dashboard-section">
        <h2>Open Rate</h2>
        <div className="metric-value">{dbData.metrics.openRate}%</div>
      </section>

      <section className="dashboard-section">
        <h2>Click Rate</h2>
        <div className="metric-value">{dbData.metrics.clickRate}%</div>
      </section>

      <section className="dashboard-section">
        <h2>Bounce Rate</h2>
        <div className="metric-value">{dbData.metrics.bounceRate}%</div>
      </section>

      {/* Database Stats */}
      <section className="dashboard-section full-width">
        <h2>Database Information</h2>
        <div className="table-container">
          <table className="data-table">
            <thead>
              <tr>
                <th>Table Name</th>
                <th>Row Count</th>
              </tr>
            </thead>
            <tbody>
              {Object.entries(dbData.tableStats).map(([tableName, count]) => (
                <tr key={tableName}>
                  <td>{tableName}</td>
                  <td>{typeof count === 'number' ? count.toLocaleString() : count}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </section>

      {/* Recent Activity */}
      <section className="dashboard-section full-width">
        <h2>Recent Activity</h2>

        <div className="tab-container">
          <div className="tab-header">
            <h3>Recent Subscribers</h3>
          </div>
          <div className="tab-content">
            {dbData.recentSubscribers.length === 0 ? (
              <p className="no-data-message">No recent subscribers.</p>
            ) : (
              <table className="data-table">
                <thead>
                  <tr>
                    <th>Email</th>
                    <th>Name</th>
                    <th>Joined Date</th>
                  </tr>
                </thead>
                <tbody>
                  {dbData.recentSubscribers.map((subscriber) => (
                    <tr key={subscriber.id}>
                      <td>{subscriber.email}</td>
                      <td>{subscriber.name || 'N/A'}</td>
                      <td>{new Date(subscriber.created_at).toLocaleDateString()}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            )}
          </div>
        </div>

        <div className="tab-container">
          <div className="tab-header">
            <h3>Recent Campaigns</h3>
          </div>
          <div className="tab-content">
            {dbData.recentCampaigns.length === 0 ? (
              <p className="no-data-message">No recent campaigns.</p>
            ) : (
              <table className="data-table">
                <thead>
                  <tr>
                    <th>Campaign Name</th>
                    <th>Subject</th>
                    <th>Status</th>
                  </tr>
                </thead>
                <tbody>
                  {dbData.recentCampaigns.map((campaign) => (
                    <tr key={campaign.id}>
                      <td>{campaign.campaign_name}</td>
                      <td>{campaign.subject}</td>
                      <td>{campaign.status}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            )}
          </div>
        </div>

        <div className="tab-container">
          <div className="tab-header">
            <h3>Recent Bounces</h3>
          </div>
          <div className="tab-content">
            {dbData.recentBounces.length === 0 ? (
              <p className="no-data-message">No recent bounces.</p>
            ) : (
              <table className="data-table">
                <thead>
                  <tr>
                    <th>Email</th>
                    <th>Bounce Type</th>
                    <th>Reason</th>
                  </tr>
                </thead>
                <tbody>
                  {dbData.recentBounces.map((bounce) => (
                    <tr key={bounce.id}>
                      <td>{bounce.email}</td>
                      <td>{bounce.bounce_type || 'Unknown'}</td>
                      <td>{bounce.reason || 'Not specified'}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            )}
          </div>
        </div>
      </section>

      <div className="dashboard-footer">
        <p className="last-updated">Last updated: {dbData.metrics.lastUpdated}</p>
      </div>
    </div>
  );
};

export default Dashboard;
